import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';

class Header extends Component
{
    render() {
        return (
            <div>
                <Navbar bg="dark">
                    <Navbar.Brand href="#home">Brand link</Navbar.Brand>
                </Navbar>
            </div>
        )
    }
}

export default Header;
